import React, { Fragment } from 'react';
import 'react-slideshow-image/dist/styles.css';
import Billeterie from './Billeterie';
import Msg_important from './Msg_important'
import Footer from './Footer'
import Navigation from './Navigation';
import Tete_affiche from './Tete_affiche'
import Map_accueil from './Map_accueil'

const Accueil = () => {

  var rien = document.querySelector('.i4ewOd-pzNkMb-LgbsSe').innerHTML = "salut"
  return (
    <Fragment> 
      <Navigation />
      {/* <div onClick={() => document.getElementById('menuopen').style.marginLeft = "-80.2%" } > */}
        <Msg_important />
        <Tete_affiche />
        <Billeterie />
        <Map_accueil />
        <Footer />
    </Fragment> 
  ) 
}

export default Accueil;
